window.getCurrPrice = (price, curr_b) => {
    curr_b = curr_b.toUpperCase();
    price = price ? price.replace(/,/g, '') : 0;
    if (!/^\d+(\.\d+)?$/.test(price.toString())) {
        return
    }
    window.decimals_fiatRate = tradeTools.get_bid_or_ask_decimals(price, curr_b, true);
    return tradeTools.num_fix(price * decimals_fiatRate.fiat_rate, decimals_fiatRate.fiat_rate_decimals)
}
    ;
window.getMarketSystem = order => {
    window.c_a = ''
        , c_b = '';
    if (typeof order.market !== 'undefined') {
        window.marketArr = [];
        window.a = order.market.includes('/');
        window.b = order.market.includes('_');
        if (a) {
            marketArr = order.market.split('/')
        }
        if (b) {
            marketArr = order.market.split('_')
        }
        if (!a && !b) {
            return {
                c_a: '',
                c_b: ''
            }
        }
        c_a = marketArr[0] ? marketArr[0].toUpperCase() : '';
        c_b = marketArr[1] ? marketArr[1].toUpperCase() : ''
    }
    return {
        c_a: c_a,
        c_b: c_b
    }
};
