window.LocalStorage = (function (ls) {
    function isExpired(name) {
        let oldTime = ls.getItem(name);
        if (!oldTime)
            return true;
        let intOldTime = parseInt(oldTime);
        let currentTime = new Date().getTime();
        let expireTime = (currentTime - intOldTime) / 1e3 / 60 / (60 * 2);
        return expireTime > 1
    }
    return {
        get: function (name, checkExpired) {
            if (!ls)
                return {
                    status: -1,
                    msg: 'storage is unavailable'
                };
            else {
                if (checkExpired) {
                    let isExpired_let = isExpired(name + '_time');
                    if (isExpired_let)
                        return {
                            status: -3,
                            msg: 'expired'
                        };
                    return ls.getItem(name) ? {
                        status: 0,
                        msg: 'get success',
                        data: ls.getItem(name)
                    } : {
                        status: -2,
                        msg: 'not store'
                    }
                }
                return ls.getItem(name) ? {
                    status: 0,
                    msg: 'get success',
                    data: ls.getItem(name)
                } : {
                    status: -2,
                    msg: 'not store'
                }
            }
        },
        set: function (name, value) {
            if (!ls)
                return {
                    status: -1,
                    msg: 'storage is unavailable'
                };
            else {
                try {
                    ls.setItem(name, value)
                } catch (oException) {
                    if (oException.name === 'QuotaExceededError') {
                        console.log('storage reset!');
                        localStorage.clear();
                        let aCookie = document.cookie.split(';');
                        for (let i = 0; i < aCookie.length; i++) {
                            let aCrumb = aCookie[i].split('=')
                                , cookieName = aCrumb[0].toString().trim();
                            if (cookieName.indexOf('_time') > -1) {
                                $.removeCookie(cookieName, {
                                    path: '/'
                                })
                            }
                        }
                        ls.setItem(name, value)
                    }
                }
                let currentTime = new Date().getTime();
                ls.setItem(name + '_time', currentTime.toString());
                if (name.indexOf('l_d_data') > -1) {
                    $.cookie(name + '_time', currentTime.toString(), {
                        path: '/',
                        secure: true
                    })
                }
                return {
                    status: 0,
                    msg: 'store success'
                }
            }
        }
    }
}
)(window.localStorage);

window.getQueryVariable = function (variable) {
    var query = window.location.search.substring(1);
    var vars = query.split("&");
    for (var i = 0; i < vars.length; i++) {
        var pair = vars[i].split("=");
        if (pair[0] == variable) {
            return pair[1]
        }
    }
    return false
}

