window.CommonFormatPrice = price => {
    price = price * 1;
    if (isNaN(price) || price == '')
        return '';
    if (price < 1) {
        price = price.toPrecision(4);
        const str = '' + price;
        if (!/e/i.test(str)) {
            return price
        }
        ; return (price * 1).toFixed(18).replace(/\.?0+$/, "")
    } else {
        let num_price = price;
        if (num_price >= 1 && num_price < 10) {
            num_price = num_price.toFixed(4)
        }
        if (num_price >= 10 && num_price < 1e3) {
            num_price = num_price.toFixed(3)
        }
        if (num_price >= 1e3) {
            num_price = num_price.toFixed(2)
        }
        return num_price
    }
}

