window.getMultiMarkets = () => {
    const multiMarkets = localStorage.getItem('pro-trade-multiple-charts');
    let tabMarkets;
    if (multiMarkets) {
        try {
            if (Object.prototype.toString.call(JSON.parse(multiMarkets)) === '[object Array]') {
                tabMarkets = JSON.parse(multiMarkets);
                tabMarkets = [...tabMarkets, GLOBAL_PRO_TRADE.currSymbol]
            } else {
                tabMarkets = [GLOBAL_PRO_TRADE.currSymbol, '', '', '']
            }
        } catch (error) {
            console.log(error);
            tabMarkets = [GLOBAL_PRO_TRADE.currSymbol, '', '', '']
        }
    } else {
        tabMarkets = [GLOBAL_PRO_TRADE.currSymbol, '', '', '']
    }
    tabMarkets = Array.from(new Set(tabMarkets)).filter(o => o).map(o => o.toUpperCase());
    return tabMarkets
}

